response.about:
Люблю своих родных (хотя порой это дорого стоит);
люблю кошек и собак, люблю горький шоколад и пирожное "картошка".
Не люблю скандалов и склок, шептаний за спиной и обсуждений "за глаза"; не люблю когда мне говорят - НЕТ (а кто-нибудь любит? :)); не люблю слабых духом, безвольных мужчин и истеричных женщин; 
не понимаю очень категоричных в своих мнениях людей; твёрдо убеждена, что словом можно не только обидеть, но и убить.
